import React from "react";
import {Modal, ModalBody, ModalFooter, ModalHeader} from "reactstrap";
import Translate from "../../../../../Translate";
import CustomizedTreeView from "../../../group/treeUi/tree";

const ClassifiersModal = props => {

    return (
        <Modal isOpen={true} size='md'>
            <ModalHeader>
                <Translate name={'Classifiers'}/>
            </ModalHeader>
            <ModalBody>
                <CustomizedTreeView
                    mainId={1}
                    mainName={'drinks'}
                    data={this.props.subGroups}
                    movingGroupStatus={this.props.movingGroupStatus}
                    startMovingGroup={this.props.startMovingGroup}
                    endeMovingGroup={this.props.endeMovingGroup}
                    editPosition={this.props.editPosition}
                />
            </ModalBody>
            {/*<ModalFooter></ModalFooter>*/}
        </Modal>
    )
}

export default ClassifiersModal
